	function __call($mth_name,$mth_arg)
	{
		echo "Unknown Member Call $mth_name<br>You can get all details by calling get_class_details() method";
	}

	function get_class_details()
	{		
		echo '<pre>';
		echo "<br><b>Class Name</b><br>";
		echo "\t".get_class($this);

		echo "<br><br><b>List of Methods</b><br>";		
		foreach (get_class_methods($this) as $key => $value) {
			echo "\t".$value."()<br>";
		}		
		
		echo "<br><b>List of Properties</b><br>";
		if(count(get_object_vars($this)) > 0)
			print_r($this);			
		else
			echo "\t"."No Properties Exists";
		
		exit;
	}

	function getImageData($file = ''){
		echo '<img src="data:'.mime_content_type($file).';base64,'.base64_encode(file_get_contents($file)).$this->emoticonsHeight.'" />';
	}


	function parseEmoticons($text = ''){
		
		return preg_replace($this->emoticonsCode, $this->emoticonsData, $text);
	}

	function printEmoticons($class = 'table'){

		$html = '<table class="'.$class.'">
					<thead>
						<tr>
							<th style="width:300px">Name</th>
							<th style="width:300px">RegEx</th>
							<th>Emoticons</th>
						</tr>
					</thead>
					<tbody>';
		
		foreach ($this->emoticonsData as $key => $value) {
			$html .= '<tr>
						<td>'.ucfirst($key).'</td>
						<td>'.$this->emoticonsCode[$key].'</td>
						<td>'.$value.'</td>
					</tr>';
		}

		$html .= '</tbody>
				</table>';

		echo $html;

	}


	
